import React, { useState } from 'react';
import './App.css';
import { Route, Link, BrowserRouter as Router, Switch } from 'react-router-dom'
import './Login'
import Login from './Login';
import GuardedRoute from 'react-guarded-route'


const ValidateUserLogged = () => {
  return sessionStorage.getItem('userLoggedIn') !== null;
}

function App() {
  return (
    <Router>
      <Switch>
        <GuardedRoute exact path='/' validatorFunction={ValidateUserLogged()} redirectTo='/login' component={Home()} />
        <GuardedRoute path="/about" validatorFunction={ValidateUserLogged()} redirectTo='/login' component={About()} />
        <GuardedRoute path="/login" validatorFunction={!ValidateUserLogged()} redirectTo='/' component={Login()} />
      </Switch>
    </Router>
  );
}

function About() {
  return (
    <h1>About</h1>
  )
}

function Home() {
  return (
    <h1>Home</h1>
  )
}

export default App;
